import React, { useRef } from 'react';
import "./contact.css";
import emailjs from '@emailjs/browser';

export const ContactUs = () => {
    const form = useRef();

    const sendEmail = (e) => {
        e.preventDefault();

        emailjs.sendForm('service_ud0u6a7', 'template_i7vauga', form.current, 'fLYLwy4PzgKnFSd7W')
            .then((result) => {
                console.log(result.text);
                console.log("message sent")
            }, (error) => {
                console.log(error.text);
            });
    };

    return (
        <section className='contact_section'>
            <div className="container_contact">
                <div className="contactInfo">
                    <div>
                        <h2>Contact Info</h2>
                        <ul className="info">
                            <li>
                                <span><img src="#" alt="Location icon" /></span>
                                <span>New Delhi</span>
                            </li>
                            <li>
                                <span><img src="#" alt="Mail icon" /></span>
                                <span><a href="#">keshavdayal205@gmail.com</a></span>
                            </li>
                            <li>
                                <span><img src="#" alt="Call icon" /></span>
                                <span>+91-9958402122</span>
                            </li>
                        </ul>
                    </div>
                    <ul className="sci">
                        <li><a href="https://www.facebook.com/nassosanagn/"><img src="/images/1.png" alt="Facebook icon" /></a></li>
                        <li><a href="https://www.instagram.com/nassosanagn_/?hl=el"><img src="/images/3.png" alt="Instagram icon" /></a></li>
                        <li><a href="https://twitter.com/nassosanagn"><img src="/images/2.png" alt="Twitter icon" /></a></li>
                        <li><a href="https://www.linkedin.com/in/nassos-anagnostopoulos-2b9631196/"><img src="/images/5.png" alt="LinkedIn icon" /></a></li>
                    </ul>
                </div>
                <div className="contactForm">
                    <h2>Send a Message</h2>
                    <form className="formBox" ref={form} onSubmit={sendEmail}>
                        <div className="inputBox w50" name="First Name">
                            <h3 className='form-h3'>First Name:</h3>
                        {/* <span>First Name</span> */}
                        <input type="text" name="user_name"/>
                        </div>
                        <div className="inputBox w50">
                        <h3 className='form-h3'>Last Name:</h3>
                        <input type="text" name="user_name" />
                        </div>
                        <div className="inputBox w50">
                        <h3 className='form-h3'>Email:</h3>
                        <input type="email" name="user_email" />
                        </div>
                        <div className="inputBox w100">
                        <h3 className='form-h3'>Message:</h3>
                        <textarea name="message" />
                        </div>
                        <div className="inputBox w100">
                        <input className="inputBox w100" rows="4" cols="50" type="submit" value="Send" />
                        </div>
                    </form>
                    </div>
                {/* </div> */}
            </div>
        </section>
    );
};

export default ContactUs
